    [],nt"revision_timestamp": "2016-05-25T00:27:21.078238",nt"name": "intermodal-passenger-connectivity-database-raw-data",nt"isopen":
    true,nt"url": null,nt"notes": "The Intermodal Passenger Connectivity Database
    (IPCD) is a nationwide data table of passenger transportation terminals, with data
    on the availability of connections among the various scheduled public transportation
    modes at each facility. In addition to geographic data for each terminal, the data
    elements describe the availability of intercity, commuter and transit rail; scheduled
    air service; intercity and transit bus; and intercity and transit ferry services.
    Transit bus service locations are not specifically included in the database. The
    transit bus network involves stops at nearly every street corner in some cities,
    and there would be little benefit to listing every street corner in the IPCD. However,
    the status of transit bus as a connecting mode is included for each facility in
    the database.",nt"license_title": "U.S. Government Work",nt"extras":
